import React from 'react';
import './SearchResults.css';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent'; 

function SearchResults() {
  return (
    <div className="SearchResults">
      <h1>Search Results</h1>
      <Card sx={{ margin: 1}}>
        <CardContent>
          <h3>song name</h3>
          <p>artist | album</p>
        </CardContent>
      </Card>
      <Card sx={{ margin: 1}}>
        <CardContent>
          <h3>song name</h3>
          <p>artist | album</p>
        </CardContent>
      </Card>
      <Card sx={{ margin: 1}}>
        <CardContent>
          <h3>song name</h3>
          <p>artist | album</p>
        </CardContent>
      </Card>
    </div>
  );
}

export default SearchResults;
